from xml.dom import minidom

def parse_svg(svg):
    model = ""
    model = base64.b64decode(model)
    model = json.loads(model.decode('utf-8'))



    doc = minidom.parseString(svg)  # parseString also exists
    path_strings = [path.getAttribute('d') for path
                    in doc.getElementsByTagName('path')]

    sorted_path = {}
    idx = 1
    for path in doc.getElementsByTagName('path'):
        if path.getAttribute('stroke'):
            parent = path.parentNode
            parent.removeChild(path)
        else:
            sorted_path[idx] = int(path.getAttribute('d').split('.')[0].replace('M',''))
            idx += 1
    # print(sorted_path)
    sorted_path = sorted(sorted_path, key=sorted_path.get)
    # print(sorted_path)
    captcha = ['','','','','']
    i = 1
    for path in doc.getElementsByTagName('path'):
        p = path.getAttribute('d')
        p = re.sub(r"[\d\.\s]", "", p)
        captcha[sorted_path.index(i)] = model.get(p)
        i+=1

    captcha_str = ''.join(captcha)
    return captcha_str


